                <h2>Networking Event Details</h2>

                <div>
                    <Link to="/networking-events"><button className="btn btn-outline-dark mr-1" >Go Back</button></Link>
                    {/*TODO: add network id to these links */}
                    <Link to="/networking-events/update/1"><button className="btn btn-outline-secondary mr-1">Update Event</button></Link>
                    <button className="btn btn-outline-danger">Delete</button>
                </div>
            </div>
        );
    }
}
